import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Sort by" select and "View" toggle buttons to appear
    await page.waitForSelector('select#sortSelect', { timeout: 5000 });
    await page.waitForSelector('.view-toggle', { timeout: 5000 });

    // Find the List View button (has class 'view-btn' and title 'List View')
    const listViewBtn = await page.$('.view-toggle .view-btn[title="List View"]');
    if (!listViewBtn) throw new Error('List View button not found');

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products to be displayed in list view (look for .products-list)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Extract some data to verify list view mode
    const productListCount = await page.$$eval('.products-list .product-card-list', els => els.length);
    const isListViewActive = await page.$eval('.view-toggle .view-btn[title="List View"]', el => el.classList.contains('active'));

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        productListCount,
        isListViewActive
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
